function Button(props) {
  const position = "py-1.5 px-5";
  const design = "bg-gray-900 border border-gray-700 rounded-3xl";
  const designCondition = props.light ? "text-white" : "text-gray-800";

  return (
    <button
      className={`${position} ${design} ${designCondition}`}
      onClick={props.onClick}
    >
      {props.text}
    </button>
  );
}

export default Button;
